import { Button, TextField } from "@mui/material";
import React from "react";

const RegisterForm = ()=>{
    return(
        <form className="registerationForm">
            <h1>Create New Accout</h1>
            <TextField name="username" type="username" value={FormData.username} label="username"></TextField>
            <TextField name="email" type="email" value={FormData.email} label="email"></TextField>
            <TextField name="password" type="password" value={FormData.password} label="password"></TextField>
            <Button type="submit" variant="contained">Register</Button>
            <label>Already have an accout? <a href='/register'>Sign In</a></label>
        </form>
    )
}

export default RegisterForm;
